import React from 'react'
import ReactDOM from 'react-dom';

class Form extends React.Component {
    constructor(props) {
        super(props);
        this.state = {nombre: '', apellido: ''};


        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);

    }

    handleChange(event) {
        this.setState({nombre:event.target.value, apellido:event.target.value});
    }

    handleSubmit(event) {
        alert('Se cargó el nombre y apellido: ' + this.state.nombre + this.state.apellido);
        event.preventDefault();
    }

    render() {
        return(
            <form onSubmit={this.handleSubmit}>
                <label>
                    Nombre:
                    <input type="text" value={this.state.nombre} onChange={this.handleChange} />

                </label>
                <label>
                    Apellido
                    <input type="text" value={this.state.apellido} onChange={this.handleChange} /> 
                </label>
                <input type="submit" value="Submit" />
            </form>
        );
    }
}

export default Form;
